import React from 'react';

import "./card.styles.css"

export const Card = (props) => (
    <>
        <tr>
        <td>
            {props.attributes.Confirmed}
        </td>
        <td>
            {props.attributes.Deaths}
        </td>
        <td>
            {props.attributes.Recovered}
        </td>
        <td>
            {props.attributes.Active}
        </td>
        </tr>
    </>
);
